import React, {Fragment} from 'react'
import defaultSlide from '../../assets/default-slide.jpg'

import {
    HorizontalLine,
    Overlay,
    Warning
} from './styled'

const BackgroundLinesComponent = (props) => {
    const { images } = props;

    const renderHorizontalLines = () => {
        let item = [];
        for (let i = 0; i < 8; i++) {
          item.push(
            <HorizontalLine 
              key={ i }
            />
          );
        }
        return item;
    };

    return (
        <Container>
            {renderHorizontalLines()}

        </Container>
    )
}


export default BackgroundLinesComponent;
